import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Container } from "reactstrap";

import Nav from "./components/modules/navigation";
import Welcome from "./components/modules/welcome";
import WeeklyNews from "./components/modules/weekly-news";
import SkillOfTheWeek from "./components/modules/skill-of-the-week";
import UpcomingWorkouts from "./components/upcoming-workouts";
import RecentlyAdded from "./components/modules/recently-added";
// import BookWorkout from "./components/book-a-workout";
// import VideoLibrary from "./components/video-library";
// import Documents from "./components/documents";
// import API from "./utils/api";

import Loading from "./components/Loading";
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";
import Home from "./views/Home";
import Profile from "./views/Profile";
import ExternalApi from "./views/ExternalApi";
import { useAuth0 } from "@auth0/auth0-react";
import history from "./utils/history";

import "./App.css";
import initFontAwesome from "./utils/initFontAwesome";
initFontAwesome();

const App = () => {
  const { isLoading, error } = useAuth0();

  if (error) {
    return <div>Oops... {error.message}</div>;
  }

  if (isLoading) {
    return <Loading />;
  }

  return (
    <Router history={history}>
      <div id="app" className="d-flex flex-column h-100">
        <NavBar />
        <Nav />
        <Welcome />
        <WeeklyNews />
        <SkillOfTheWeek />
        <Container className="flex-grow-1 mt-5">
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/UpcomingWorkouts" component={UpcomingWorkouts} />
            <Route path="/profile" component={Profile} />

          </Switch>
        </Container>
        <RecentlyAdded />
        {/* <Route exact path="/" component={Dashboard} /> */}
        {/* <Route exact path="/bookworkout" component={BookWorkout} /> */}
        {/* <Route exact path="/documents" component={Documents} /> */}
        {/* <Route exact path="/videolibrary" component={VideoLibrary} /> */}

        <Footer />
      </div>
    </Router>
  );
};

export default App;
